import React from 'react'
const PriceCard = ({ data }) => {
    return ( 
    <div className="w3-center w3-text-gray" style={{
      width:'100%'
  }}>
        <b>{data.heading}</b>
        <p  style={{
                    marginTop:0,
                    // width:'10%'
                }}>{data.text}</p>
        <button
                type="button"
                className="w3-button w3-round-xxlarge w3-text-white"
                style={{
                    width:'50%',
                    margin:0,
                    backgroundColor: data.color
                }}
              >
                <b>{data.price}</b>
              </button>
    </div> );
}

export default PriceCard;
